import React from 'react'

import Logo from '../../../assets/logo.svg'
import css from './Layout.module.scss'

const Layout = (props) => {
  return (
    <div className={css.Body}>
      <img src={Logo} alt='Krateo' className={css.Logo} />
      {props.children}
    </div>
  )
}

export default Layout
